import React from "react";
import "../footer/footer.css";

function footer() {
  return (
    <div>
      <div className="information_section">
        <div className="service_section">
          <div className="service_button"></div>
          <div className="service_information"></div>
        </div>
        <div className="support_section"></div>
        <div className="myaccount_section"></div>
      </div>
      <div className="contact_section"></div>
    </div>
  );
}

export default footer;
